import './App.css';

import React, { useState } from 'react';
import { predict } from "./components/API";

const usePrediction = (text) => {
  const [prediction, setPrediction] = React.useState(null);
  React.useEffect(() => {
    predict(text).then((data) => setPrediction(data));
  }, [predict]);
  return prediction;
}

function App() {
  return (
    <div>
      <nav>
        <a href="/om">Om siden</a>
      </nav>
      <div className="full-page-container">
        <h1>Mann eller Kvinne?</h1>
        <p>Skriv og la maskinen gjette om du er mann eller kvinne</p>
        <textarea></textarea>
        <input type="submit" value="Gjett" onClick={usePrediction('jeg liker å yeete')}></input>
        <div className="prediction">
          <p>Maskinen gjetter: {prediction}</p>
        </div>
      </div>
      <footer>
        <p>Laget av <a href="https://lblend.moe">LBlend</a></p>
        <a href="https://github.com/LBlend/mann-eller-kvinne">Kildekode</a>
      </footer>
    </div>
  );
}

export default App;
